(async function() {
  const imgElement = document.getElementById('qr-img-variant_rx_state_["variant_uuid"]');
  const successTrigger = document.getElementById('qr_copy_success_trigger'); 
  console.log("1. Ejecutando script de copiado para:", 'qr-img-variant_rx_state_["variant_uuid"]');
  
  if (!imgElement) {
    console.error("ERROR CRTICO: Imagen QR no encontrada con ID:", 'qr-img-variant_rx_state_["variant_uuid"]');
    alert("Error: Imagen QR no encontrada.");
    return; 
  }
  
  // Si la imagen no es un <img> o no ha cargado, espera.
  // Es mejor usar imgElement que sourceElement, ya que la funcin qr_code_display
  // debe asegurar que el ID est en el <img>.
  try {
    if (imgElement.tagName.toLowerCase() === 'img' && !imgElement.complete) {
        console.log("2. Esperando a que la imagen IMG cargue...");
        await new Promise((resolve, reject) => { 
            imgElement.onload = resolve; 
            imgElement.onerror = reject;
        });
    }

    // 3. Creacin del Canvas
    const canvas = document.createElement("canvas");
    const padding = 20; 
    canvas.width = imgElement.naturalWidth + (padding * 2);
    canvas.height = imgElement.naturalHeight + (padding * 2);
    const ctx = canvas.getContext("2d");

    ctx.fillStyle = "white";
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.drawImage(imgElement, padding, padding, imgElement.naturalWidth, imgElement.naturalHeight);
    console.log("3. Imagen dibujada en Canvas. Buscando Blob...");

    await new Promise((resolve, reject) => {
        canvas.toBlob(async (blob) => {
            if (blob) {
                try {
                    // 4. Escribir en el portapapeles (el punto ms probable de fallo)
                    await navigator.clipboard.write([
                        new ClipboardItem({ [blob.type]: blob })
                    ]);
                    
                    console.log("4. XITO: Imagen copiada al portapapeles.");
                    if (successTrigger) {
                        successTrigger.click(); // <--- Dispara el evento del Toast
                    }
                    resolve();
                } catch (err) {
                    // Fallo de SecurityError (navegador bloqueando la escritura)
                    console.error("FALLO (Clipboard API): El navegador bloque la escritura del Blob. Causado por: ", err);
                    alert("ERROR DE COPIADO: El navegador ha bloqueado la escritura al portapapeles. Esto puede ocurrir si el sitio no es seguro (no HTTPS) o por permisos.");
                    resolve(); 
                }
            } else {
                // Fallo al crear el Blob (Tainting por CORS, si la imagen fuera remota)
                console.error("FALLO (Blob): Error al crear Blob. POSIBLE FALLO DE CORS (Canvas Tainted).");
                alert("ERROR DE COPIADO: Fallo al procesar la imagen (Canvas Tainted). Intenta de nuevo.");
                resolve();
            }
        }, "image/png");
    });

  } catch (err) {
    // Falla en drawImage (si es un SVG o si el QR no ha cargado correctamente)
    console.error('ERROR (Procesamiento): Error al procesar la imagen (posiblemente un SVG o la imagen no carg).', err);
    alert('ERROR DE COPIADO: La imagen del QR no se pudo procesar. Verifica la consola del navegador para ms detalles.');
  }
})();
